import React from "react";
import styled from 'styled-components';
import {Button, Col, Input, Row} from "antd";

const StyledDiv=styled.div`
  border-top: 1px solid grey;
  margin: 3vh;
`;



const Contents=() =>{
    return(
        <StyledDiv>
            <Row>
                <Col xs={24} md={12} style={{margin:'10vh 3vh 3vh 3vh'}}>
                    <h1>리에이블과 함께<br/>일회용품을 줄여봐요!</h1>
                    <h1>이메일을 적어주시면<br/>리에이블 서비스에 관한 알림을 보내드립니다.</h1>
                </Col>
                <Col xs={24} md={10} style={{whiteSpace:'nowrap', margin:'10vh 3vh 3vh 3vh'}}>
                    <Input placeholder="Email" style={{marginRight:'1vh',width:'75%'}} />
                    <Button type="primary">등록</Button>
                </Col>
            </Row>
        </StyledDiv>
    );
}

export default Contents;
